import Login from '../Pages/Login';
import Home from '../Pages/Home';
import SignIn from '../Pages/SignIn';
import Iphones from '../Pages/Iphones';

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute'; // Supondo que você criou um componente como o exemplo acima

const AppRoutes = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={
                    <ProtectedRoute>
                        <Home />
                    </ProtectedRoute>
                } />
                <Route path="/login" element={<Login />} />
                <Route path="/si" element={<SignIn />} />
                <Route path="/Iphones" element={
                    <ProtectedRoute>
                        <Iphones />
                    </ProtectedRoute>
                } />
            </Routes>
        </Router>
    );
}

export default AppRoutes;
